&quot;I have always been trapped by you. I'm controlled by this emotion that I can't fathom.&quot;

Invited by a friend to a drinking party, Ryou reunites with Fujishiro, a man he's hated since childhood. His ability to socialize with anyone remains unchanged. Remembering his irritation towards Fujishiro being liked by everyone surrounding him, he decides not to get involved, but&hellip; When they were left alone, Fujishiro poked at his true feelings, saying &quot;you hate me, don't you?&quot; And confessing he 'likes' Ryou, the only person who hates him. He pushed him down and came on to him.

Is Fujishiro just playing with Ryou&hellip;? The boundary of the ambiguous and impure love and hate.

With a mysterious look and a merciful smile, the young Father Ayase fascinates the parishioners. The only person who knows him perfectly is the daycare teacher Kaidou. Both grew up in the same institution, creating a bond of brothers, but the relationship begins to change when Kaidou hears the following rumor: &quot;It seems that Ayase is a prostitute&quot;

What does that mean&hellip;?

The forbidden love between a daycare teacher and a Father!

&quot;I love you.&quot; &quot;That's disgusting.&quot;

The fidgety and red-faced kouhai who confessed to him turned out to be Shuichirou. Although Atsushi rebuffs Shuichirou in less than 3 seconds, the latter relentlessly confesses his love every day. Even saying his type is &quot;girls with big boobs&quot; doesn't stop Shuichirou.

In the midst of that, Atsushi tries to get Shuichirou to back off by doing perverted things to him&hellip;?!

&quot;Even if this universe is truly nothing more than a brutal, bloody, dark forest, we Cultivators will burn all that we have just to give off a single weak flickering spark in the darkness!&quot;

&quot;No matter how weak each spark is, how short-lived, how small... As long as the sparks flow unabated, then one day one of those sparks will light some tinder, and that tinder shall light some fallen branches, and those branches shall set ablaze each and every last tree of the forest!&quot;

&quot;In the end, even the smallest sparks will eventually set the dark forest ablaze and illuminate the whole world!&quot;

In Kyoto, in the late 1800s, the son of a local book-binder, Kyujuro Fukakusa sees his father murdered before his eyes and vows revenge. In his quest for justice, he answers the recruitment call of the Shinsengumi (or &quot;The new squad&quot;) a newly-formed special brigade of samurai loyal to the shogun. There he meets fellow recruit and proficient swordsmen, the enigmatic Daisuke Kamakiri.

Despite the gap in their fighting skill levels, the two forma close bond, but can it survive the age of upheaval that is descending on &quot;The Wolves of Mibu?&quot;
(from emanga.com)

A reunion after 7 years. And I'm still in love with Hijiri&hellip;

Ito, a hairdresser, decided to rent a share-house in Tokyo. As he moved in, he noticed a sweet, nostalgic scent. On the same day, another person was moving into the house. It was Takehisa Hijiri, his close friend that he fell in love with!

Ito ends up getting excited whenever he smells Hijiri's scent. Because it was between men &ndash; a love that will never come true &ndash; he thought of giving up, but his body still reacts?!

Although she had traveled to the Royal Capital to train as a lady of the court, before she realized it, the daughter of an impoverished Earl was seen as nothing more than another of the servants. It was during one of her usual morning cleaning rounds when by chance the Crown Prince Isaac, who was rumored for one reason or another to keep all women at arm's length, passed by, but&hellip;

When she tried to return the document he dropped, she got caught up in a maelstrom of trouble?!

And for that matter, what do you mean that happens to all the women who approach the Crown Prince&hellip;?!

Naoto, whose looks are his only good point, is working as a model. One morning, he wakes up to find a disgusting tail growing on his backside. 

&quot;What kind of disease is this!? Am I going to die!?&quot;

After unconsciously becoming an incubus overnight, Naoto is now in danger of being attacked by pervy men everywhere he goes!

An intelligent and domineering woman encounters a carefree, flamboyant prince at a brothel. Initially, she thinks of it as nothing more than a chance meeting, but little did she know their fates would end up being so deeply intertwined...

&quot;If you hold no love for me, then I will give up my love for you as well.&quot;

A romance story about love and loss set in ancient times.

