Tsugumi has been working for Apal Society for more than seven years. When she first started working at one of their stores, she had a really close friend who she could talk to about anything. 
&quot;I fell in love with him, and I thought he felt the same, but when we kissed, we knew it was only a misunderstanding.&quot;
Five years later, she was assigned to her lover's department, and her old friend once again appeared in front of her.

&quot;Senpai, I want you to fall for me.&quot;

When Hotaka, his junior in high school, suddenly confessed to him during their student days, Yuu felt so embarrassed that he gave him the brush-off. He was brusque with Hotaka, but even now, he regrets hurting his cute junior whom he cared about more than anyone.

However, when they happen to meet each other again after several years, Hotaka has turned into a devilish man, bent on seducing a drunk Yuu&hellip;.
